import React from "react";
import Header from "./Components/Header";
import HomePage from "./Components/HomePage"
import Nav from "./Components/Nav"
import "./App.css";
import {Router} from "@reach/router"


function App() {
  return (

      <div>
        <Header />
        <Router>
          <HomePage path = "/" />
          <Nav />
          </Router>
      </div>

  );
}

export default App;
